{
  "prompt.template": "{{prompt_text}}",
  "prompt.variables": "{\n  \"prompt_text\": \"system: \\nYou are an AI assistant that helps users answer questions given a specific context and conversation history. You will be given a context and chat history, and then asked a question based on that context and history. Your answer should be as precise as possible, and should only come from the context.\\nPlease add citation after each sentence when possible in a form \\\"(Source: citation)\\\".\\n\\n user: \\n Content: # What is \\\"human data\\\" and why is it important to source responsibly?\\n\\nTo enable people to self-identify, consider using the following survey questions. \\n\\n### Age\\n\\n**How old are you?**\\n\\n*Select your age range*\\n\\n[*Include appropriate age ranges as defined by project purpose, geographical region, and guidance from domain experts*]\\n\\n- \\\\# to # \\n- \\\\# to # \\n- \\\\# to # \\n- Prefer not to answer\\n\\n\\n### Ancestry\\n\\n**Please select the categories that best describe your ancestry**\\n\\n*May select multiple*\\n\\n[*Include appropriate categories as defined by project purpose, geographical region, and guidance from domain experts*]\\n\\n- Ancestry group \\n- Ancestry group \\n- Ancestry group \\n- Multiple (multiracial, mixed Ancestry) \\n- Not listed, I describe myself as: _________________ \\n- Prefer not to answer \\n\\n\\n### Gender identity\\n\\n**How do you identify?**\\n\\n*May select multiple*\\n\\n[*Include appropriate gender identities as defined by project purpose, geographical region, and guidance from domain experts*]\\n\\n- Gender identity \\n- Gender identity \\n- Gender identity \\n- Prefer to self-describe: _________________ \\n- Prefer not to answer \\n\\n\\n>[!CAUTION] \\n>In some parts of the world, there are laws that criminalize specific gender categories, so it may be dangerous for data contributors to answer this question honestly. Always give people a way to opt out. And work with regional experts and attorneys to conduct a careful review of the laws and cultural norms of each place where you plan to collect data, and if needed, avoid asking this question entirely. \\n\\n[Download the full guidance here.](https://bit.ly/3woCOAz)\\n\\n## Next steps\\nFor more information on how to work with your data: \\n\\n- [Secure data access in Azure Machine Learning](concept-data.md)\\n- [Data ingestion options for Azure Machine Learning workflows](concept-data-ingestion.md)\\n- [Optimize data processing with Azure Machine Learning](concept-optimize-data-processing.md)\\n\\nFollow these how-to guides to work with your data after you've collected it:\\n\\n- [Set up image labeling](how-to-create-image-labeling-projects.md)\\n- [Label images and text](how-to-label-data.md)\\nSource: concept-sourcing-human-data.md\\n\\nContent: # Run Jupyter notebooks in your workspace\\n\\n1. Type your comment and post it with the tool or use **Ctrl+Enter**.\\n1. Once a comment is posted, select **...** in the top right to:\\n    * Edit the comment\\n    * Resolve the thread\\n    * Delete the thread\\n\\nText that has been commented will appear with a purple highlight in the code. When you select a comment in the comments pane, your notebook will scroll to the cell that contains the highlighted text.\\n\\n> [!NOTE]\\n> Comments are saved into the code cell's metadata.\\n\\n## Clean your notebook (preview)\\n\\nOver the course of creating a notebook, you typically end up with cells you used for data exploration or debugging. The *gather* feature will help you produce a clean notebook without these extraneous cells.\\n\\n1. Run all of your notebook cells.\\n1. Select the cell containing the code you wish the new notebook to run. For example, the code that submits an experiment, or perhaps the code that registers a model.\\n1. Select the **Gather** icon that appears on the cell toolbar.\\n    :::image type=\\\"content\\\" source=\\\"media/how-to-run-jupyter-notebooks/gather.png\\\" alt-text=\\\"Screenshot: select the Gather icon\\\":::\\n1. Enter the name for your new \\\"gathered\\\" notebook.  \\n\\nThe new notebook contains only code cells, with all cells required to produce the same results as the cell you selected for gathering.\\n\\n## Save and checkpoint a notebook\\n\\nAzure\\u00a0Machine\\u00a0Learning\\u00a0creates\\u00a0a\\u00a0checkpoint\\u00a0file\\u00a0when\\u00a0you\\u00a0create\\u00a0an\\u00a0*ipynb*\\u00a0file.\\n\\nIn the notebook toolbar, select the menu and then **File&gt;Save and checkpoint** to manually save the notebook and it will add a checkpoint file associated with the notebook.\\n\\n:::image type=\\\"content\\\" source=\\\"media/how-to-run-jupyter-notebooks/file-save.png\\\" alt-text=\\\"Screenshot of save tool in notebook toolbar\\\":::\\n\\nEvery\\u00a0notebook\\u00a0is\\u00a0autosaved\\u00a0every\\u00a030\\u00a0seconds.\\u00a0AutoSave\\u00a0updates\\u00a0only\\u00a0the\\u00a0initial\\u00a0*ipynb*\\u00a0file,\\u00a0not\\u00a0the\\u00a0checkpoint\\u00a0file.\\n \\nSelect **Checkpoints** in the notebook menu to create a named checkpoint and to revert the notebook to a saved checkpoint.\\n\\n## Export a notebook\\n\\nIn the notebook toolbar, select the menu and then **Export As** to export the notebook as any of the supported types:\\n\\n* Notebook\\n* Python\\n* HTML\\n* LaTeX\\n\\n:::image type=\\\"content\\\" source=\\\"media/how-to-run-jupyter-notebooks/export-notebook.png\\\" alt-text=\\\"Export a notebook to your computer\\\":::\\n\\nThe exported file is saved on your computer.\\n\\n## Run a notebook or Python script\\n\\nTo run a notebook or a Python script, you first connect to a running [compute instance](concept-compute-instance.md).\\n\\n* If you don't have a compute instance, use these steps to create one:\\n\\n    1. In the notebook or script toolbar, to the right of the Compute dropdown, select **+ New Compute**. Depending on your screen size, this may be located under a **...** menu.\\n        :::image type=\\\"content\\\" source=\\\"media/how-to-run-jupyter-notebooks/new-compute.png\\\" alt-text=\\\"Create a new compute\\\":::\\n    1. Name the Compute and choose a **Virtual Machine Size**. \\n    1. Select **Create**.\\n    1. The compute instance is connected to the file automatically.  You can now run the notebook cells or the Python script using the tool to the left of the compute instance.\\n\\n* If you have a stopped compute instance, select  **Start compute** to the right of the Compute dropdown. Depending on your screen size, this may be located under a **...** menu.\\n\\n    :::image type=\\\"content\\\" source=\\\"media/how-to-run-jupyter-notebooks/start-compute.png\\\" alt-text=\\\"Start compute instance\\\":::\\n    \\nOnce you're connected to a compute instance, use the toolbar to run all cells in the notebook, or Control + Enter to run a single selected cell. \\n\\nOnly you can see and use the compute instances you create.  Your **User files** are stored separately from the VM and are shared among all compute instances in the workspace.\\n\\n## Explore variables in the notebook\\nSource: how-to-run-jupyter-notebooks.md\\n\\nContent: # How to deploy a registered R model to an online (real time) endpoint\\n\\nOnce you have verified that you have at least one custom environment, use the following steps to build a container.\\n\\n1. Open a terminal window and sign in to Azure.  If you're doing this from an [Azure Machine Learning compute instance](quickstart-create-resources.md#create-a-compute-instance), use:\\n\\n    ```azurecli\\n    az login --identity\\n    ```\\n\\n    If you're not on the compute instance, omit `--identity` and follow the prompt to open a browser window to authenticate.\\n\\n1. Make sure you have the most recent versions of the CLI and the `ml` extension:\\n    \\n    ```azurecli\\n    az upgrade\\n    ```\\n\\n1. If you have multiple Azure subscriptions, set the active subscription to the one you're using for your workspace. (You can skip this step if you only have access to a single subscription.)  Replace `<SUBSCRIPTION-NAME>` with your subscription name.  Also remove the brackets `<>`.\\n\\n    ```azurecli\\n    az account set --subscription \\\"<SUBSCRIPTION-NAME>\\\"\\n    ```\\n\\n1. Set the default workspace.  If you're doing this from a compute instance, you can use the following command as is.  If you're on any other computer, substitute your resource group and workspace name instead.  (You can find these values in [Azure Machine Learning studio](how-to-r-train-model.md#submit-the-job).)\\n\\n    ```azurecli\\n    az configure --defaults group=$CI_RESOURCE_GROUP workspace=$CI_WORKSPACE\\n    ```\\n\\n1. Make sure you are in your project directory.\\n\\n    ```bash\\n    cd r-deploy-azureml\\n    ```\\n\\n1. To build the image in the cloud, execute the following bash commands in your terminal. Replace `<IMAGE-NAME>` with the name you want to give the image.\\n\\n    If your workspace is in a virtual network, see [Enable Azure Container Registry (ACR)](how-to-secure-workspace-vnet.md#enable-azure-container-registry-acr) for additional steps to add `--image-build-compute` to the `az acr build` command in the last line of this code.\\n\\n    ```azurecli\\n    WORKSPACE=$(az config get --query \\\"defaults[?name == 'workspace'].value\\\" -o tsv)\\n    ACR_NAME=$(az ml workspace show -n $WORKSPACE --query container_registry -o tsv | cut -d'/' -f9-)\\n    IMAGE_TAG=${ACR_NAME}.azurecr.io/<IMAGE-NAME>\\n    \\n    az acr build ./docker-context -t $IMAGE_TAG -r $ACR_NAME\\n    ```\\n\\n> [!IMPORTANT]\\n> It will take a few minutes for the image to be built. Wait until the build process is complete before proceeding to the next section.  Don't close this terminal, you'll use it next to create the deployment.\\n\\nThe `az acr` command will automatically upload your docker-context folder - that contains the artifacts to build the image - to the cloud where the image will be built and hosted in an Azure Container Registry.\\n\\n\\n## Deploy model\\n\\nIn this section of the article, you'll define and create an [endpoint and deployment](concept-endpoints.md) to deploy the model and image built in the previous steps to a managed online endpoint.\\n\\nAn *endpoint* is an HTTPS endpoint that clients - such as an application - can call to receive the scoring output of a trained model. It provides:\\n\\n> [!div class=\\\"checklist\\\"]\\n> - Authentication using \\\"key & token\\\" based auth\\n> - SSL termination\\n> - A stable scoring URI (endpoint-name.region.inference.ml.Azure.com)\\n\\nA *deployment* is a set of resources required for hosting the model that does the actual scoring. A **single** *endpoint* can contain **multiple** *deployments*. The load balancing capabilities of Azure Machine Learning managed endpoints allows you to give any percentage of traffic to each deployment. Traffic allocation can be used to do safe rollout blue/green deployments by balancing requests between different instances.\\n\\n### Create managed online endpoint\\n\\n1. In your project directory, add the **endpoint.yml** file with the following code. Replace `<ENDPOINT-NAME>` with the name you want to give your managed endpoint.\\n\\n    ```yml\\nSource: how-to-r-deploy-r-model.md \\n\\n chat history: \\nuser: how are you? \\nassistant:\"\n}"
